Z([3,' 一、定义 艾文公司：梓潼艾文网络科技有限公司简称，创联众益商务系统网站经营者和提供者。 《创联众益商务系统》：艾文公司用于消费积分赠送的系统平台和返还分配工具，艾文享有自主知识产权的计算机软件。 创联商城：梓潼艾文创联商贸有限公司负责经营的第三方电商平台。 消费积分返还：在创联众益平台消费能获得消费金额一定比例的积分赠送，积分按系统规则经返还转化后进行分配，20%转为扶贫公益捐助资金，20%转为养老护理资金，其余60%可以在平台消费或直接提现（需扣除税金和服务费13%）。\n      消费共享金：指商家向创联众益平台按16%比例购买赠送会员积分的金额，消费共享金将会以一定比例的积分的形式记录到商家和消费者的会员账户上，并按系统返还分配规则返还分配给消费者、商家及社会公益。 积分：积分是消费共享金的分配权重参照，积分按系统规则经返还可转化为消费红利（1积分\x3d1元人民币）。 创联众益是经济发展新常态下的新型业态，目的在于为大众创业、万众创新创造条件，为经济发展扩大内需增添动力，为扶贫公益资金社会募捐增加途径，为广大会员提供更好的消费养老和创业服务平台。创联众益网站是《创联众益商务系统》的会员注册、管理、结算消费、买卖、创业的平台。艾文有权根据市场和使用的需要，链接或合并符合系统规划及共同利益的相关平台、网站、网页。\n      '])
