Z([3,' 二、系统规则 （一）会员注册与加入 《创联众益商务系统》是一个综合创新的第三方服务平台和应用工具。成为创联众益商务系统的会员，是您使用本系统平台服务的前提条件。您所享有的权利与义务，以本系统所发布的相关规则文书为准。 （二）会员的积分主要来源 1、会员在本系统平台内每一笔的消费金额，以相应积分的形式记录在会员账户上。 2、系统联盟商家交付的消费共享金，即按16%购买积分的金额，也以等额积分的形式记录在商家会员账户上。 （三）系统的返还机制 系统以会员当天账户上积分总额作为其消费共享金返还分配的权重参照。每满100积分作为一个计量单元参与积分转换，不满一个单元不参与积分转换计量结算。系统根据当天平台整体运营及消费情况等多个综合因素，按当天实际产生的积分销售额+上一天未分配的余额汇总与全部积分分配权重比率，计算出每天的返还速率（每日约万分之三左右，根据“收付同源、以收定支”属性每日根据交易升降比例可在万分之三基础上下浮动），将积分转换成消费红利，消费红利经分配后可以继续消费或提现到银行卡（不满100元不能提现，提现时要收取一定的税费和3%的手续费）\n      （四）返还资金的来源及属性 根据系统协议，进驻平台参与合作创业的商家（又名联盟商家），在销售完成后要将赠送积分等额的16%作为消费共享金，缴付到系统运营的专用账户，商家付出积分购买金额也以等额积分的形式纪录在商家注册账户上。 在阿里、京东、国美等商城中，“平台使用费”本应是属于平台的投资人（或股东）的收益和利润。但艾文主动贡献应得、既得的利润，作为消费促成的营业收入，作为返还资金的来源，并把它定义为“消费共享金”用于消费返还。在收益上减少“平台使用费”这一项，通过其他的如广告费、大数据、现金流、品牌价值等附加值收益，支持、保障系统平台的正常运作。\n      （五）积分的返还与使用 会员在云创联众益商务系统所获得的积分，是由联盟商家向系统平台购买，并根据销售交易约定由卖方会员商家自愿向买方会员单方赠予的一种行为。是系统平台从联盟商家会员经营中收取部分利润，对会员购买商品或服务行为的相应回馈（自主自愿、真实理性原则），系统平台对积分的返还比率、时间、数量不做任何保证承诺。 参与系统推广创业的会员，将在系统创业合作计划的规则下，获得系统相应单方面的奖励，这些都将是会员在系统的权利。系统在确保本系统规则规定运行的前提下，予以会员相应的权利回报。本系统平台再次明确确认：系统对会员购物获赠积分返还、推广创业奖励等均以本协议所制定的规则为准，系统没有、也不会额外持币分红、奖励、发钱。系统的价值来源均是在系统平台上，是所有会员参与的结果。系统通过为所有会员提供一个网络服务系统平台助其经营销售，并按系统规则的规定获得一定比例的积分赠送返还。\n      系统按规则运行返还，返还率的高低完全取决于系统交易额和会员的参与度，且但并不保证每天一定有多少的积分转化为消费红利，也不能保证在您系统账户上的积分多长时间内全部转化为消费红利。请真实消费，理性消费，按需消费。系统规则坚决杜绝虚假交易，投机投资，也请关注系统每天公布的信息变化。如会员间相互勾结，串通进行虚构交易 ，一经查实，创联众益商务系统有权取消该会员非法获取的所有积分，并有权收回会员在系统中通过非法兑换积分已经提取的现金，必要时，系统可以注销或冻结该会员的账号并将相关违法违规行为提供司法机关请求依法处理。\n      （六）平台规则 创联众益平台提供了商家营销、消费投资、推广创业工具，您在享受平台给您带来的权益的同时，应当认同《创联众益商务系统》的商业理念和商业价值，遵循创联众益平台系统规则。您同意并接受创联众益平台制定并在平台公示的规则，如违反规则造成第三方或创联众益平台的利益损失，艾文公司有权根据规则对您的违规行为作出处理，您同意并接受艾文公司的处理，同时您享有申诉的权利。 创联众益平台的规则遵守国家相关的法律法规，旨在维护平台的公共利益。根据属性分为如下四大部分： 1、《会员》，包含 《会员》\n      、《会员注册、账号设置与管理》、《会员的创业分配》和《会员合作创业计划协议书》、《会员退会规则》等。 2、《系统总则》，包括：《创联众益商城系统》、《创联众益消费积分返还商业模式》、《创联众益消费积分返还规则与制度》、和《创联众益商城系统联盟、商会、公司的概念、定义，组成、权责》等 3、《加盟》，包括：《加盟的资格、条件和权利义务》、《加盟商积分成本与权益级别规则》和《加盟商诚信守则》等。 4、《代理》，包括：《代理级别划分规则》、《代理级别权属范围与所属关系》和《代理资格、条件、权益》等相关文书。\n      （七）会员管理 1、创联众益商务系统实行会员入会自愿、退会自由制度，不强迫任何个人和企业入会或退会，会员退会的，应按照《会员退会规则》和相关的退会流程办理退会手续。 2、如您在享受创联众益消费获利期间，有蓄意诋毁、破坏创联众益商务系统，或有欺诈他人，破坏会员与创联众益的和谐关系，违背创联众益商业价值和理念等其他造成恶劣影响的违规行为，艾文公司有权根据您的违规所造成的危害程度，对您的账户将采取警告、冻结或永久注销等违规处罚措施，触犯法律法规的移交司法机关追究法律责任，您同意并接受创联众益公司的对您上述违规行为的处理。\n      3、 平台规则的解释权和修改权归艾文公司所有，艾文公司有权对本规则进行不定期修订。相关修改将在创联众益商城系统网站（）执行公示程序，如公示期发现修订内容对多数用户的权益构成重大影响，则启动意见征求程序。公示期结束后，规则修订内容即告生效。如生效后的修订内容与您的意愿不符，请及时退出本系统网站。 以上规则中的相关要求仅作为您参与本系统的条件，不代表国家、地方、部门关于自然人、法人的身份买卖活动所涉产品、价格、质量等的各种资质、证照、条件等相关的法律、法规、规章。会员应按国家法律法规的要求，办理在本平台活动所需要的各种资质、证照，并确保符合相关条件。如因此产生的问题，须由会员自己负责。\n      '])
